import React from 'react';

const QuestionDisplay = ({ generatedQuestions }) => {
  return (
    <div>
      <h2>Generated Questions:</h2>
      <ul>
        {generatedQuestions.map((question, index) => (
          <li key={index} data-number={index + 1}>
            <span>{question}</span>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default QuestionDisplay;
